import React from 'react';
import data from "../response.json"

export default (props) => {

    let { data } = props
    console.log(data)
    return (
        <div>
            {
                data && <div>
                    {
                        data.children.map((item, index)=>{
                            return(
                                <li> {item.name} ()</li>
                            )
                        })
                    }
                </div>
            }


        </div>
    )
}
